import * as React from 'react';

import './Home.css';
import Courses from "../components/Cards";
import Navbar from "../components/Navbar"

import { Link } from 'react-router-dom';
import './styles.css';

const SidebarContainer = styled.div`
  width: 250px;
  height: 100vh;
  background-color: #5a3d99;
  color: white;
  display: flex;
  flex-direction: column;
  padding: 10px;
  position: fixed;
`;

const SidebarLink = styled(Link)`
  color: white;
  text-decoration: none;
  padding: 10px;
  margin: 5px 0;
  border-radius: 5px;

  &:hover {
    background-color: #774bbd;
  }
`;

function Home (){
    return(
        <>
            <Navbar/>
            <SidebarContainer>
                <SidebarLink to="/">Inicio</SidebarLink>
                <SidebarLink to="/gestion-turnos">Gestión de turnos</SidebarLink>
                <SidebarLink to="/gestion-pacientes">Gestión de pacientes</SidebarLink>
                <SidebarLink to="/gestion-personal-salud">Gestión personal de la salud</SidebarLink>
                <SidebarLink to="/configuracion-agenda-recursos">Configuración agenda recursos</SidebarLink>
                <SidebarLink to="/gestion-reportes">Gestión de reportes</SidebarLink>
                <SidebarLink to="/recepcion-pacientes">Recepción de pacientes</SidebarLink>
                <SidebarLink to="/configuracion-general">Configuración general</SidebarLink>
                <SidebarLink to="/agenda-medica">Agenda médica</SidebarLink>
                <SidebarLink to="/gestion-totem">Gestión de totem</SidebarLink>
                <SidebarLink to="/farmacia-central">Farmacia central</SidebarLink>
            </SidebarContainer>
            <Courses/>
        </>
    )
}

export default Home;
